from collections import deque
from functools import lru_cache
from typing import List


from math import gcd
#using gcd from math module
class Solution:
    def replaceNonCoprimes(self, nums: List[int]) -> List[int]:
        result = []
        for num in nums:
            while result:
                b = result[-1]
                gcd_ = gcd(num, b)
                if gcd_ == 1:
                    break
                result.pop()
                num *= b // gcd_
            result.append(num)
        return result


#complete with prime sieve
class Solution:
    def replaceNonCoprimes(self, nums: List[int]) -> List[int]:
        def sieve(n:int) -> List[int]:
            primes = [True] * (n+1)
            primes[0] = primes[1] = False
            for num in range(int(n**0.5)+1):
                if primes[num]:
                    for x in range(num*num, n+1, num):
                        primes[x] = False
            return [x for x, status in enumerate(primes) if status]

        max_n = int(max(nums)**0.5)+1
        primes = sieve(max_n)
        primes_set = set(primes)

        @lru_cache(maxsize=None)
        def is_prime(n:int):
            if n in primes_set:
                return True
            if n > max_n:
                return False
            return len(factor(n)) == 1
            
        @lru_cache(maxsize = None)
        def factor(n:int) -> List:
            factors = []
            for prime in primes:
                while n//prime * prime == n:
                    factors.append(prime)
                    n = n // prime
                    if n==1:
                        return factors

            factors.append(n)
            primes.append(n)
            primes_set.add(n)
            return factors

        @lru_cache(maxsize = None)
        def are_congruent(a,b) -> int: #returns lcm or 0
            if a<b:
                return are_congruent(b,a)
            if is_prime(a) or is_prime(b):
                if a//b * b != a:
                    return 0
                return a

            fac_a = factor(a)
            fac_b = factor(b).copy()
            coprimes = False
            for x in fac_a:
                if x in fac_b:
                    fac_b.remove(x)
                    coprimes = True
            if not coprimes:
                return 0
            
            new_num = 1
            for x in fac_a + fac_b:
                new_num *= x
            return new_num

        result = []
        while len(nums) >1:
            # print(nums[:10])
            # input()
            a = nums.pop()
            b = nums[-1]

            if a==1 or b==1:
                result.append(a)
                continue

            if a==b:
                continue

            if is_prime(a) and is_prime(b):
                result.append(a)
                continue

            if lcm:=are_congruent(a,b):
                nums[-1] = lcm
                if result:
                    nums.append(result.pop())
            else:
                result.append(a)

        result += nums
        result.reverse()
        return result

